css:
@-moz-document domain(awesome-go.com) {
     body {
         background-color: #002b36;
    }
     h1, h2, h3, h4, h5, h6 {
         color: #268bd2;
    }
     a {
         color: #859900;
    }
     a:visited {
         color: #2aa198;
    }
     p {
         color: #fdf6e3;
    }
     ul li {
         color: #93a1a1;
         list-style: none;
    }
     ul li > a::before, ul li > p::before {
         color: #859900;
         content: "\2022";
         font-size: 1em;
         padding-right: 1em;
         position: relative;
         top: 0em;
    }
}
